import { ActionPanel, Action } from "@raycast/api";
import { Cursor } from "./interface";

export const getActions = (cursor: Cursor, primaryAction: ExtensionPreferences["primaryAction"]) => {
  const actions = {
    copy: <Action.CopyToClipboard title="Copy Cursor" content={cursor.svg} />,
    paste: <Action.Paste title="Paste Cursor" content={cursor.svg} />,
  };

  return (
    <ActionPanel>
      {primaryAction === "copy" ? (
        <>
          {actions.copy}
          {actions.paste}
        </>
      ) : (
        <>
          {actions.paste}
          {actions.copy}
        </>
      )}
    </ActionPanel>
  );
};

